DROP TABLE Registration;

CREATE TABLE Registration(
    registration_id     VARCHAR(7)  NOT NULL PRIMARY KEY,    
    pet_id              VARCHAR(7)  NOT NULL,    
    registration_type   VARCHAR(11) NOT NULL CHECK (UPPER(registration_type) IN ('WALK IN', 'APPOINTMENT')),    
    registration_date   DATE        NOT NULL,
    registration_time   VARCHAR(5)  NOT NULL,        
    CONSTRAINT fk_registration_pet FOREIGN KEY(pet_id) REFERENCES Pet(pet_id)    
);


